- input: "TEXT\x1CC00167130\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's Request for Further Information dated July 22, 2009 regarding
    the Amended 30 Day Post-General Report.  The Committee has clarified all issues
    regarding this request on the Amended Report.  Please note that all Offsets from
    the Obama for America Committe have been corrected on this amended report as well.
    \ The Offsets were inadvertantly reported on Schedule A for Line 11c.  -  The
    Mack & Crounse Group expenditure on 10/30/2008 was inadvertantly reported on the
    wrong Schedule and has been correctly disclosed on Schedule B for Line 30b on
    the amended report.  Please note that determination of usual and normal charges
    for Voter File Access for payments received on Schedule A, Line 17 of the Committees
    report was calculated by the total cost of developing and hosting our online voter
    file and dividing it by the number of records within the file as well as the presumed
    number of overall users. The cost to the organization is then determined by the
    number of records requested and the length of time access will be granted. i.e.
    Statewide or congressional charges are based on the number of records in the district
    or entire state as requested.  -  This Report discloses payments for salary or
    wages in regard to Federal Election Activity on Line 30b.  Please note that the
    employees that were disclosed on Schedule H4 supporting Line 21(a) as payroll
    spent less than 25% of their time during the period working on any Federal Election
    Activity or activities in connection with a Federal Election therefore salary
    payments were allocable.  This also includes fringe benefits for those specific
    employees.  -  Please note that transfers in from the Democratic National Committee
    and the Democratic Congressional Campaign Committee were not used as the Federal
    component of expenditures or disbursements that were used for federal election
    activities paid for in any part by Levin funds.  The committee utilizes standard
    accounting procedures, and separate bank accounts for Transfers from these committees,
    and a detailed chart of accounts to ensure that Federal funds transferred from
    national state district and local party committees are used in compliance with
    the CFR.  The Memo Schedule A's that itemize the committees share of the gross
    contributions received through the joint fundraising activities from the ASDC
    Dollars for Democrats, ASDC Partnership Program (Association of State Democratic
    Chairs), ASDC Victory Fund, Committee for Change and the Democratic National Committee
    State Party Victory Fund are provided on a quarterly basis. The transfer of the
    joint fundraising proceeds received during this reporting period from the ASDC
    Dollars for Democrats, ASDC Partnership, Committee for Change and Democratic National
    Committee State Party Victory Fund programs represents the committee's share of
    proceeds for contributions received during this or prior reporting periods. The
    memo entries for these contributions are included in this or a prior report of
    the committee.\n"
